country = "?";
countrycode = "?";
region = "?";
regionname = "?";

function GetServerRegion(ip)
	local http = game:GetService("HttpService")
	
	if ip then
		local location
		local good,bad = pcall(function()
			location = http:JSONDecode(syn.request{Url = "http://ip-api.com/json/"..ip, Method = "GET"}.Body)
		end)

		if good and location.region and location.regionName then
			return location.country, location.countryCode, location.region , location.regionName
		else
			return "?", "?", "?", "?"
		end
	else
		warn("fatal error fetching server ip. error: ")
		return "?", "?", "?", "?"
	end
end

game:GetService("NetworkClient").ConnectionAccepted:Connect(function(peer)
    local ip = tostring(peer):match("(.-)|")
    country, countrycode, region, regionname = GetServerRegion(ip)
end)
